В некоторых случаях синхронизация данных может занять длительное время:
 - медленный канал связи;
 - большой объем данных;
 - доступно обновление приложения в Интернете.

In einigen Fällen kann die Datensynchronisation sehr lange dauern: 
- langsamer Kommunikationskanal; 
- großes Datenvolumen; 
- Anwendungsupdate ist im Internet verfügbar.

În unele cazuri, sincronizarea datelor poate dura mult timp:
 - canal de comunicare lent;
 - volum mare de date;
 - actualizarea aplicației este disponibilă pe Internet.

Bazı durumlarda veri senkronizasyonu uzun sürebilir: 
- yavaş iletişim kanalı; 
- büyük veri hacmi; 
- İnternet üzerinden uygulama güncellemesi mevcut.

En algunos casos la sincronización de datos puede llevar mucho tiempo:
 - canal lento de comunicación; 
 - grande volumen de datos;
 - actualización de la aplicación disponible en Internet.
